import React from "react";
import head from "../../../../../public/assets/Kody/head.png";
import body from "../../../../../public/assets/Kody/body.png";

const AnimatedKody = () => {
  return (
    <div className="relative h-[30em] w-[20em]">
      <img
        Src={body}
        alt="kody"
        width={150}
        className="absolute top-28 left-1/2 -translate-x-1/2"
      />
      <img
        src={head}
        alt="kody"
        width={200}
        className="absolute top-0 left-1/2 -translate-x-1/2"
      />
    </div>
  );
};

export default AnimatedKody;
